import React, { useState } from 'react';
import axios from 'axios';

const CheckNews = () => {
  const [title, setTitle] = useState('');
  const [description, setDescription] = useState('');
  const [result, setResult] = useState(null);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  
  const handleSubmit = async (e) => {
    e.preventDefault();
    
    try {
      setError('');
      setResult(null);
      setLoading(true);
      
      const response = await axios.post('http://localhost:5000/api/news/check', {
        title,
        description
      });
      
      setResult(response.data);
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to check news');
    } finally {
      setLoading(false);
    }
  };
  
  return (
    <div className="flex flex-col items-center">
      <div className="w-full max-w-2xl">
        <div className="bg-white shadow-md rounded-lg px-8 pt-6 pb-8 mb-4">
          <h2 className="text-2xl font-bold mb-6 text-center">Check News</h2>
          
          {error && (
            <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-4">
              {error}
            </div>
          )}
          
          <form onSubmit={handleSubmit}>
            <div className="mb-4">
              <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="title">
                News Title
              </label>
              <input
                className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                id="title"
                type="text"
                placeholder="Enter the title of the news article"
                value={title}
                onChange={(e) => setTitle(e.target.value)}
                required
              />
            </div>
            
            <div className="mb-6">
              <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="description">
                News Description
              </label>
              <textarea
                className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                id="description"
                placeholder="Enter the content or description of the news article"
                rows="6"
                value={description}
                onChange={(e) => setDescription(e.target.value)}
                required
              />
            </div>
            
            <div className="flex items-center justify-between">
              <button
                className="bg-blue-600 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline w-full"
                type="submit"
                disabled={loading}
              >
                {loading ? 'Analyzing...' : 'Analyze News'}
              </button>
            </div>
          </form>
        </div>
        
        {result && (
          <div className={`bg-white shadow-md rounded-lg p-6 mb-4 border-l-4 ${result.result ? 'border-green-500' : 'border-red-500'}`}>
            <div className="flex justify-between items-center mb-4">
              <h3 className="text-xl font-bold">Analysis Result</h3>
              <div className={`px-4 py-1 rounded-full text-white font-semibold ${result.result ? 'bg-green-500' : 'bg-red-500'}`}>
                {result.result ? 'REAL' : 'FAKE'}
              </div>
            </div>
            
            <div className="mb-4">
              <div className="mb-2 font-medium">Confidence Score</div>
              <div className="w-full bg-gray-200 rounded-full h-4">
                <div 
                  className={`h-4 rounded-full ${result.result ? 'bg-green-500' : 'bg-red-500'}`}
                  style={{ width: `${result.confidencePercentage}%` }}
                ></div>
              </div>
              <div className="text-right mt-1 text-sm">{result.confidencePercentage}%</div>
            </div>
            
            <div className="mb-4">
              <div className="font-medium mb-2">Analyzed News</div>
              <div className="bg-gray-50 p-3 rounded">
                <div className="font-medium">{result.title}</div>
                <div className="text-gray-600 mt-1">{result.description}</div>
              </div>
            </div>
            
            {result.analysis && (
              <div>
                <div className="font-medium mb-2">Detailed Analysis</div>
                <div className="bg-gray-50 p-3 rounded whitespace-pre-line text-sm">
                  {result.analysis}
                </div>
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
};

export default CheckNews;
